import React from "react";
import "./headerHome.css";

export default function HeaderHome() {
  return (
    <div className="HeaderHome w-100 p-16 position-fixed top-0 d-flex justify-content-between align-items-center">
      <a href="" className="logo">
        <ion-icon name="dice-outline"></ion-icon>
        <div className="logo__text">DashBoard</div>
      </a>

      <div className="account">
        <div className="account__display">
          <div
            className="account__avt"
            style={
              ({
                backgroundImage:
                  "url(" +
                  "https://www.kindpng.com/picc/m/78-786207_user-avatar-png-user-avatar-icon-png-transparent.png" +
                  ")",
              })
            }
          ></div>
        </div>

        <div className="account__hidden">
          <div className="account__title">Signed in as</div>

          <div className="account__fullname">Thái Hà Nguyễn</div>

          <div className="setting">
            <div className="setting__display">Account Settings</div>
            <div className="setting__hidden"></div>
          </div>

          <button className="signOutBtn">Sign out</button>
        </div>
      </div>
    </div>
  );
}
